import React from 'react';
import {TextField, Grid,Box, Stack} from '@mui/material'
import LoginForm from './LoginForm';

/**
 *  Login Main Component
 * 
 */

const Login = () => {
    return(
        <Grid container spacing={2}>
            <Grid 
             item 
             xs = {12} 
             sm = {7} 
             md = {4}
             >
             <Stack
              alignContent={'center'}
              sx = {{padding : 8}}
              >
                <LoginForm />
             </Stack>
            </Grid>

            <Grid 
             item
             xs = {12}
             sm = {5}
             md = {8}
             >
                <Box
                 sx = {{
                    backgroundColor : 'success.main',
                    margin : 0,
                    padding : 20
                 }}
                />
            </Grid>
        </Grid>
    );
}

export default Login;
